def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if isinstance(level, str):
            if obj.columns.name != level:
                raise ValueError(
                    "level name {} is not the name of the index".format(level)
                )
        else:
            raise ValueError("level can only be a string representing the column name")

    # a passed-in Grouper, directly convert
    if any(isinstance(key, cls) for cls in [Grouper, BaseGrouper]):
        binner, grouper, obj = key._get_grouper(obj, validate=False)
        if key.key is None:
            return grouper, [], obj
        else:
            return grouper, {key.key}, obj

    if not isinstance(key, (str, list)):
        raise ValueError("key must be a string or a list of strings representing column names")

    keys = [key] if isinstance(key, str) else key
    match_axis_length = len(keys) == len(group_axis)

    if match_axis_length and not any(isinstance(g, (dict, callable)) for g in keys):
        if not all(g in obj.columns for g in keys):
            raise KeyError("Some or all of the specified keys do not exist in the columns")

    groupings = [Grouping(group_axis, g, name=g, sort=sort, observed=observed) for g in keys]

    if len(groupings) == 0:
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, [], obj
